import React from 'react';
import './App.css';
import Footer from './components/footer/Footer';
import Header from './components/header/Header';
import Operators from './components/operators/Operators';
import {BrowserRouter, Route, Switch} from 'react-router-dom';
import CheckList from './components/Check/CheckList';

function App(props) {
  let Oper = props;
    return (
      <BrowserRouter>
        <div className="app__wrapper">
          <Header />
          <Route exact path="/main" render={Operators} />
          <Switch>
            <Route
              exact
              path={"/checklist/"+Oper.id[0]}
              render={() => <CheckList content={Oper.name[0]} />}
            />
            <Route
              exact
              path={"/checklist/"+Oper.id[0]}
              render={() => <CheckList content={Oper.name[1]} />}
            />
            <Route
              exact
              path={"/checklist/" + Oper.id[0]}
              render={() => <CheckList content={Oper.name[2]} />}
            />
          </Switch>
          <Footer />
        </div>
      </BrowserRouter>
    );
}

export default App;
